import 'bootstrap/dist/css/b'

const root = ReactDOM.createRoot(document.getElementById('rooted'));
root.render(
  <React.StrictMode>
    <GlobalStyle />
    <GlobalProvider>
      <App />
    </GlobalProvider>
  </React.StrictMode>
);
